import React from "react";

class Select extends React.Component {
    render() {
        const arr =  this.props.currencies;
        return (
            <select value={this.props.value}>
                  {
                      arr.map((elem, index)=>{
                      return (<option key={index} value={elem.cc} rate={elem.rate}>
                          {elem.cc}
                      </option>)
                      })
                  }
              </select>
        );
    }
}

export default Select;
